import {useDispatch, useSelector} from "react-redux"
import React, { useEffect , useState} from "react";
import axios from "axios"


function MyBookings({match}) {

    const userLogin = useSelector((state) => state.userLogin);
    const { userInfo } = userLogin;

    const [address, setAddress] = useState("");
    const [floor, setFloor] = useState("");
    const [date, setDate] = useState("");
    const [desk, setDesk] = useState("");
    const [noFloors, setFloors] = useState("");
    const [fetchedData, setFetchedData] = useState([]);
    useEffect(() => {

        const fetching = async () => {
              
            const config = {
                headers: {
                    Authorization: `Bearer ${userInfo.token}`,
                },
              };

            const response  = await axios.get(`/api/bookings/${match.params.user}`, config)
            console.log(response.data)
            setFetchedData(response.data)
          };
      
          fetching();
    },[match.params.user])

      
    return(
        <div>
            
            <div className="sidebar">
                <a href="#lo">Desk Booking</a>
                <a href="#contact">Room Booking</a>
                <a href="#about">Your Bookings</a>
            </div>
            <div className="content">
                <h1>Current Bookings!</h1>
                {fetchedData?.map((b) => 
                <table class="table table-hover">
                    <thead>
                        <tr>
                            <th scope="col">Type</th>
                            <th scope="col">Address</th>
                            <th scope="col">Date</th>
                            <th scope="col">Floor</th>
                            <th scope="col">Desk</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr class="table-success">
                        <th scope="row">Active</th>
                        <td>{b.address}</td>
                        <td>{b.date}</td>
                        <td>{b.floor}</td>
                        <td>{b.desk}</td>
                        </tr>
                    </tbody>
                </table>
                )}
                <h2>Bookings History:</h2>
                {fetchedData?.filter((filtered) => filtered.date=new Date()).map((b) =>
                <table class="table table-hover">
                    <thead>
                        <tr>
                            <th scope="col">Type</th>
                            <th scope="col">Address</th>
                            <th scope="col">Date</th>
                            <th scope="col">Floor</th>
                            <th scope="col">Desk</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr class="table-success">
                        <th scope="row">Active</th>
                        <td>{b.address}</td>
                        <td>{b.date}</td>
                        <td>{b.floor}</td>
                        <td>{b.desk}</td>
                        </tr>
                    </tbody>
                </table>
                )}

            </div>
        </div>
        
    )
}

export default MyBookings;
